//import { FaFacebookSquare, FaInstagramSquare, FaYoutubeSquare } from 'react-icons/fa';
//import "./CSS/style.css";

const Navbar = () => {
    return (
        <>
            <nav className="main-nav">
                {/*Logo*/}
                <div className="logo">
                    <h2>
                        <span>S</span>arte
                        <span>G</span>roup
                    </h2>
                </div>
                {/*Menu links*/}
                

                {/*Social Media Links*/}

                <div className="social-media">
                    <ul className="social-media-desktop">
                       
                        {/* <li>
                            <a href="https://www.facebook.com/"><FaFacebookSquare className="facebook"/></a>
                        </li>
                        <li>
                            <a href="https://www.instagram.com/accounts/login/"><FaInstagramSquare className="instagram" /></a>
                        </li>
                        <li>
                            <a href="https://www.youtube.com/"><FaYoutubeSquare className="youtube"/></a>
                        </li>
   */}
                    </ul>

                </div>
                
            </nav>
                      
        </>

    )
}

export default Navbar
